StateMachineElement.EntryScript:
//Get square position and size based on operator click and grid dimensions
var colWidth = grid.width/grid.columns;
var rowHeight = grid.height/grid.rows;
square.x = operatorClick.x-(operatorClick.x%colWidth)+colWidth/2;
square.y = operatorClick.y-(operatorClick.y%rowHeight)+rowHeight/2;
square.width = squareDimension.value;
square.height = squareDimension.value;
//Put the fixation target where the square is
target.x = square.x;
target.y = square.y;            
//Make square visible to user and indicate this to operator by 
//bringing its alpha back to 255.
square.subjectView = true;
square.alpha = 255;

StateMachineElement.FrameScript:
//If we're in assisted calibration mode and the opeartor clicked, update 
//eye calibration values
if(operatorClick.newClick && assistedCalibration.value)
{
	//Set the newClick value back to false, in case the operator clicks again right away
	operatorClick.newClick = false;
	//Get latest x,y eye positions
	var x = posSig.getValue("x"); 
	var y = posSig.getValue("y");
	var colWidth = grid.width/grid.columns;
	var rowHeight = grid.height/grid.rows;
	var text = "";
	if((Experiment.xGain == 0) || (Experiment.yGain == 0))
	{
		text =		"Assisted Calibration does\n"+
					"not work when either gain\n"+
					"value is zero"
	}
	//If square is in the center, calculate offsets
	else if( (Math.abs(square.x - 400) < (colWidth/4.0))
		&& (Math.abs(square.y - 300) < (rowHeight/4.0))
			)
	{
		Experiment.xOffset = Experiment.xOffset + (square.x-x)/Experiment.xGain;
		Experiment.yOffset = Experiment.yOffset + (square.y-y)/Experiment.yGain;
		text = "Offsets were calculated"
	}
	//If square is not in the center, calculate gains
	else
	{
		var xGainC = 0;
		var yGainC = 0;
		if(Math.abs(square.x - 400) > (colWidth/4.0))
		{
			Experiment.xGain = Experiment.xGain*((square.x-400)/(x-400));
			xGainC = 1;
		}
		if(Math.abs(square.y - 300) > (rowHeight/4.0))
		{
			Experiment.yGain = Experiment.yGain*((square.y-300)/(y-300));
			yGainC = 1;
		}
		if(xGainC || yGainC)
		{		
			text = (xGainC && yGainC)?"XGain and YGain were\n":xGainC?"XGain was ":"YGain was ";
			text = text + "calculated";
		}
	}
	//Tell operator what we did and put the text where the box was
	assistFeedback.text = text;
	var textX = square.x+square.width;
	if(textX + assistFeedback.width > 800)
		textX = square.x-assistFeedback.width;
	assistFeedback.setPos(textX,square.y-square.height/2.0);
	assistFeedback.visible = true;
}

StateMachineElement.ExitScript:
//The user either looked at this point or didn't.  Lets turn off 
//the square so that it will be interesting when it comes back on
//and indicate to the operator that we did this by bringing the 
//square opacity down to half.
square.subjectView = false;
square.alpha = 122;

Result.EntryScript:
//User fixated on square.  Set it green to indicate this
//to the operator
square.red = 0;

StateMachineElement.ExitScript:
//Square will still be green if the user fixated last time.  
//Turn it back to yellow now.
square.red = 255;

//If there was a feedback message from the Assisisted Calibration system,
//we can stop showing it now.
assistFeedback.visible = false;

//Later logic will look to see if there is a new click available for the 
//purposes of assisted calibration.  Set newClick back to false
//so that the new click can be detected.
operatorClick.newClick = false;

StateMachineElement.EntryScript:
//Update target radius from the parameter
target.radius = targetRadius.value;

//If assisted calibration is being used, change grid color 
//and show the assistance label
if(assistedCalibration.value)
{
	assistLabel.visible = true;
	grid.setColor(0,255,0);
}

StateMachineElement.FrameScript:
//Sense Phase
//Calculate data values
var prevFrameTime = lastTime.value - prevTime.value;
var currFrameTime = playTime.value-lastTime.value;
var lastCDY = avgCDY.value;
var lastUDY = avgUDY.value;
var lastBDX = currBallPos.getValueAsNum('x')-lastBallPos.getValueAsNum('x');
var lastBDY = currBallPos.getValueAsNum('y')-lastBallPos.getValueAsNum('y');
var cYVel = 0;
var uYVel = 0;
var bXVel = lastBallVel.getValueAsNum('x');
var bYVel = lastBallVel.getValueAsNum('y');
if(prevFrameTime > 0)
{
	cYVel = lastCDY/prevFrameTime;
	uYVel = lastUDY/prevFrameTime;

}

//Control Phase
//Calculate new ball velocity and position offsets
//(Velocities don't define position offsets because non-overlap conditions might mean that
//the ball does not move exactly according to its velocity this frame)
var bXOffset = 0;
var bYOffset = 0;
if(hadCollision(cPaddle))
{
	compSound.play();
	bXVel = -bXVel;
	bYVel = bYVel+frictionCoeff.value*(cYVel-bYVel);
	bXOffset = (cPaddle.x+cPaddle.width/2.0+ball.radius+1)-currBallPos.getValueAsNum('x');
}
else if(hadCollision(uPaddle))
{
	userSound.play();
	bXVel = -bXVel;
	bYVel = bYVel+frictionCoeff.value*(uYVel-bYVel);
	bXOffset = (uPaddle.x-uPaddle.width/2.0-ball.radius-1)-currBallPos.getValueAsNum('x');
}

//Bounce ball of screen edget
if((ball.y - ball.radius <= 0)&&bYVel < 0)
{
	sideSound.play();
	bYVel = -bYVel;
	bYOffset = ball.radius - ball.y;
}
if((ball.y + ball.radius >= 600)&&bYVel > 0)
{
	sideSound.play();
	bYVel = -bYVel;
	bYOffset = -ball.radius + (600-ball.y);
}


//Take whichever offset is greater.  The one calculated from the velocity or the one 
//needed to move the ball out of a collision condition
if(Math.abs(bXVel*currFrameTime) > Math.abs(bXOffset))
	bXOffset = bXVel*currFrameTime;
if(Math.abs(bYVel*currFrameTime) > Math.abs(bYOffset))
	bYOffset = bYVel*currFrameTime;

//Act Phase
//Update data values for next frame and move the displayed actors
//Update data values for next frame
prevTime.value = lastTime.value;
lastTime.value = playTime.value;
avgCDY.value = (4*avgCDY.value + (currCY.value-lastCY.value))/5;
avgUDY.value = (4*avgUDY.value + (uPaddle.y-lastUY.value))/5;
lastCY.value = currCY.value;
lastUY.value = uPaddle.y;
lastBallPos.setValue('x',currBallPos.getValueAsNum('x'));
lastBallPos.setValue('y',currBallPos.getValueAsNum('y'));
lastBallVel.setValue('x',bXVel);
lastBallVel.setValue('y',bYVel);

//Move displayed actors
moveBall(bXOffset,bYOffset);
moveUserPaddle();
moveCompPaddle(currFrameTime);

ControlElement.Script:
if(ball.x > 800)
	return 'CompWon';
if(ball.x < 0)
	return 'UserWon';
if(playTime.value > maxPlayTime.value)
	return "TimeUp";

ScriptFunction.Script:
var x = currBallPos.getValueAsNum('x');
var y = currBallPos.getValueAsNum('y');
x += xOffset;
y += yOffset;
currBallPos.setValue('x',x);
currBallPos.setValue('y',y);
ball.x = x;
ball.y = y;

var bBot = ball.y-ball.radius;
var bTop = ball.y+ball.radius;
var bLeft = ball.x-ball.radius;
var bRight = ball.x+ball.radius;
var pLeft = paddle.x-paddle.width/2.0;
var pRight = paddle.x+paddle.width/2.0;
var pBot = paddle.y-paddle.height/2.0;
var pTop = paddle.y+paddle.height/2.0;
if(bBot > pTop)
	return false;
if(bTop < pBot)
	return false;
if(bRight < pLeft)
	return false;
if(bLeft > pRight)
	return false;
return true;

var offsetSpeed = 0;
if(frameTime)
	offsetSpeed = (ball.y-currCY.value)/frameTime;

if(Math.abs(offsetSpeed) > maxCompSpeed.value)
	offsetSpeed = maxCompSpeed.value * (offsetSpeed/Math.abs(offsetSpeed));
currCY.value += (offsetSpeed*frameTime);
cPaddle.y = currCY.value;
